import {Box, styled} from "@mui/material"

import { navData } from "../../Constants/data";

const Component = styled(Box)`
   display: flex;
`;
const NavBar = () => {

    return(
        <Component>
            {
                navData.map(data =>(
                    <Box>
                        <img src={data.url} alt="nav" />
                        <p>{data.text}</p>
                    </Box>
                ))
            }

        </Component>
    )
}

export default NavBar;
